import React from 'react'
import { useGlobalContext } from '../context'
import Loading from './Loading'

const People = () => {
    const { people, loading } = useGlobalContext()



    if (loading) {
        return <Loading />
    }

    if (people.length === 0) {
        return (
            <h2 className='section-title'>
                no Visitors matched your search criteria
            </h2>
        )
    }

    return (
        <section className='section'>
            <h2 className='section-title'>Visitors</h2>
            <div className='cocktails-center'>
                {people.map((item) => {
                    const { user_name, user_surname, user_status, visitors } = item;
                    console.log(user_name, user_surname, user_status)
                    console.log(visitors)
                })}
            </div>
        </section>
    )
}

export default People
